import { s3, file, write } from "bun";

const svg = s3("logo.svg", {
  accessKeyId: process.env.S3_ACCESS_KEY,
  secretAccessKey: process.env.S3_SECRET_KEY,
  endpoint: process.env.S3_ENDPOINT,
  bucket: process.env.S3_BUCKET,
});

// Upload a local file to S3
await write(svg, file("./logo.svg"));

// Upload a Response to S3
await write(
  svg, 
  await fetch("https://bun.sh/logo.svg")
);

// Download from S3 as text 
const text = await svg.text();
// or .json(), .bytes(), etc

// Presign a URL
const url = svg.presign();
console.log(url);

